const ErrorPage = () => {
  return (
    <div>
      <div>404 Error!</div>
      <img src="https://res.cloudinary.com/dftvewldz/image/upload/v1610068685/cryingcat.jpg" />
      <div>Did you get lost?</div>
      <div>Here's the way back home!</div>

    </div>
  )
}

export default ErrorPage;
